tables.table_schema:
CREATE TABLE concert_data ( 
    concert_id INT PRIMARY KEY, 
    concert_name VARCHAR(255), 
    location VARCHAR(255), 
    audience_count INT 
);

CREATE TABLE ConcertAudienceDemographics (
  audience_id UUID PRIMARY KEY,
  age INT,
  gender VARCHAR,
  location VARCHAR
);

CREATE TABLE Concerts (
  concert_id UUID PRIMARY KEY,
  concert_name VARCHAR,
  venue VARCHAR,
  date DATE
);

CREATE TABLE DemographicsAnalysis (
  analysis_id UUID PRIMARY KEY,
  concert_id UUID REFERENCES Concerts(concert_id),
  audience_id UUID REFERENCES ConcertAudienceDemographics(audience_id),
  analysis_result TEXT
);

CREATE TABLE ConcertAudienceDemographics (
    concert_id INT PRIMARY KEY,
    age_group VARCHAR(50),
    gender VARCHAR(10),
    location VARCHAR(100)
);

CREATE TABLE Artists (
    artist_id INT PRIMARY KEY,
    artist_name VARCHAR(100),
    genre VARCHAR(50)
);

CREATE TABLE Venues (
    venue_id INT PRIMARY KEY,
    venue_name VARCHAR(100),
    location VARCHAR(100),
    capacity INT
);
